import { Fragment } from 'react';
import Counter from './components/Counter';
import Header from './components/Header';
import Auth from './components/Auth';
import { authActions } from './store';


function App() {
  return (
    <Fragment>
      <Header />
      {authActions.isAuthenticated && <Auth />}
      <Counter />
    </Fragment>
  );
}

export default App;
